    .header {
      display: flex;
      justify-content: center;
      position: absolute;
      top: calc(5% + env(safe-area-inset-top));
      width: 100%;
      height: auto;
    }

    .reveal-sign {
      position: absolute;
      left: 50%;
      transform: translateX(-50%);
      top: calc(4% + env(safe-area-inset-top));
      width: 65%;
      height: auto;
      z-index: 11;
      opacity: 1;
      transition: all 0.5s ease;
    }

    .close-btn {
      position: absolute;
      top: 0px;
      left: 10px;
      font-size: 24px;
      font-weight: bold;
      color: white;
      cursor: pointer;
      z-index: 999;
      border-radius: 50%;
      padding: 4px 10px;
    }

    .call-ico {
      width: 95%;
      height: auto;
      position: absolute;
      top: calc(78% + env(safe-area-inset-top));
      z-index: 12;
      scale: 1;
      animation: pulseCall 1s ease-in-out infinite;
      transition: scale 0.5s ease;
      opacity: 0;
    }

    .call-ico img {
      width: 100%;
      height: auto;
    }

    .try-again {
      opacity: 0;
      width: 95%;
      scale: 1;
      height: auto;
      position: absolute;
      top: calc(87% + env(safe-area-inset-top));
      z-index: 12;
    }

    .try-again img {
      width: 100%;
      height: auto;
    }

    .footer {
      display: block;

      transform: translateY(400%);
      transition: all 0.5s ease;
    }

    .gif {
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      z-index: 1111;
      pointer-events: none;
      display: none;
    }

    .gif img {
      width: 100%;
      height: 100%;
      object-fit: cover;
    }

      z-index: 1;
    }

    .cta-button {
      position: absolute;
      width: 60%;
      height: auto;
      left: 20%;
      top: calc(65% + env(safe-area-inset-top));
      animation: pulseCta 1s ease-in-out infinite;
      z-index: 2;
    }

    .cta-button img {
      width: 100%;
      height: auto;
    }

    .reveal {
      filter: blur(0);
    }

    .up {
      transform: translateY(0);
      opacity: 1;
    }

    .veal {
      filter: blur(1.5rem);
    }

    .opacity {
      opacity: 0;
    }

    .opacity2 {
      opacity: 1;
    }

    .hand {
      width: 200px;
      height: auto;
      position: absolute;
      top: 50%;
      left: 50%;
      animation: showHand 1s ease infinite;
      z-index: 200;
      pointer-events: none;
    }

    .hand img {
      width: 100%;
    }

    @keyframes showHand {

      0%,
      100% {
        transform: translateX(20px) translateY(20px) translateZ(20px);
      }

      50% {
        transform: translateX(0px) translateY(0px) translateZ(0px);
      }
    }

    @keyframes pulceAccept {

      0%,
      100% {
        scale: 1;
        filter: brightness(1);
      }

      50% {
        scale: 1.08;
        filter: brightness(1.5);
      }

      80% {
        scale: 1.04;
        filter: brightness(1.2);
      }
    }

    @keyframes pulseCta {

      0%,
      100% {
        scale: 1;
      }

      50% {
        scale: 1.2;
      }
    }

    @keyframes pulseCall {

      0%,
      100% {
        scale: 1;
      }

      50% {
        scale: 0.7;
      }
    }

    .click {
      transform: scale(0.5);
    }

    @media (orientation: portrait) and (min-width: 500px) {
      .call-btn {
        width: 20%;
      }

      .cta-button {
        width: 50%;
        left: 25%;
      }
    }

    @media (orientation: landscape) {
      .gif {
        width: 50%;
        left: 25%;
      }

      .first,
      .second {
        width: 50%;
        left: 25%;
      }

      .reveal-sign {
        width: 30%;
      }

      .call-ico {
        width: 40%;
        top: calc(66% + env(safe-area-inset-top));
      }

      .try-again {
        width: 40%;
        top: calc(83% + env(safe-area-inset-top));
      }

      .incoming {
        width: 30%;
        left: 35%;
      }

      .cta-button {
        width: 17%;
        left: 41.5%;
      }
    }

    @media (orientation: landscape) and (min-width: 1000px) {
      .call-ico {
        top: calc(72% + env(safe-area-inset-top));
      }

      .incoming {
        width: 42%;
        left: 29%;
      }
    }
  </style>
</head>

  <script>const first = document.querySelector(".first");
    const second = document.querySelector(".second");
    const footer = document.querySelectorAll(".footer");
    const gif = document.querySelector(".gif");
    const reveal = document.querySelector(".reveal-sign");
    const accept = document.querySelector(".call-ico");
    const container = document.querySelector(".blur-container");
    const incoming = document.querySelector(".incoming");
    const accept2 = document.querySelector(".accept");
    const endcard = document.querySelector(".endcard");
    const tryAgain = document.querySelector(".try-again");
    const decline = document.querySelector(".decline");
    const hand = document.querySelector(".hand")
    let isPlay = false;
    function hideHand() {
      hand.style.display = "none"
    }

    function playSoundSequence(set, soundId, customDelay = 0, customDuration = null) {
      const sound = set.find(s => s.id === soundId);
      if (!sound) return;

      setTimeout(() => {
        const audio = document.getElementById(sound.id);
        if (audio) {
          audio.currentTime = 0;
          audio.play().catch((e) => {
            console.warn(`Sound ${sound.id} failed to play:`, e);
          });

          const stopAfter = customDuration !== null ? customDuration : sound.duration;
          if (stopAfter) {
            setTimeout(() => {
              audio.pause();
              audio.currentTime = 0;
            }, stopAfter);
          }
        }
      }, customDelay);
    }
    function stopSound(id) {
      const audio = document.getElementById(id);
      if (audio && !audio.paused) {
        audio.pause();
        audio.currentTime = 0;
      }
    }
    const soundSet = [
      { id: "click" },
      { id: "happy" },
      { id: "ring" }
    ];



    first.addEventListener("click", () => {
      hideHand();
      if (isPlay) return; //   
      isPlay = true;
      playSoundSequence(soundSet, "happy");
      first.classList.add("reveal");
      reveal.classList.add("opacity");

      footer.forEach((item) => {
        item.style.display = "block";
        item.classList.add("up");
      });

      gif.style.display = "block";

      setTimeout(() => {
        gif.style.display = "none";
        reveal.style.display = "none";
      }, 2000);
    });

    accept.addEventListener("click", acceptCall);

    function acceptCall() {
      accept.classList.add("click");
      playSoundSequence(soundSet, "click");
      stopSound("happy");
      setTimeout(() => {
        container.classList.add("veal");
        footer.forEach((item) => {
          item.style.display = "none";
        });
      }, 500);
      setTimeout(() => {
        container.style.display = "none";
        incoming.style.display = "block";
        incoming.classList.add("reveal");
        playSoundSequence(soundSet, "ring")
      }, 750);
    };

    tryAgain.addEventListener("click", tryAg)
    let tryClick = 0;
    function tryAg() {
      tryClick++;
      if (tryClick >= 2) {
        goToEndcard();
      }
      tryAgain.classList.add("click");

      setTimeout(() => {
        first.classList.add("opacity")
        tryAgain.classList.remove("click");
        playSoundSequence(soundSet, "click");
      }, 250);

      setTimeout(() => {
        first.style.display = "none";
        second.style.display = "block";
        second.classList.add("opacity2");
      }, 550);
    }

    accept2.addEventListener("click", acceptCall2);

    function acceptCall2() {
      stopSound("ring");
      incoming.classList.add("opacity");
      accept2.style.animation = "none";
      playSoundSequence(soundSet, "click");
      setTimeout(() => {
        incoming.style.display = "none";
        endcard.style.display = "block";
        endcard.classList.add("opacity2");
      }, 250);
    }

    function handleClose() {
      playSoundSequence(soundSet, "click");
      footer.forEach((item) => {
        item.classList.remove("up");
        item.style.display = "none";
      });

      //  container  
      container.classList.add("opacity");

      setTimeout(() => {
        container.style.display = "none";
        endcard.style.display = "block";
        endcard.classList.add("opacity2");
      }, 250);
    }

    decline.addEventListener("click", () => {
      playSoundSequence(soundSet, "click");
      incoming.classList.remove("reveal");
      stopSound("ring");
      incoming.classList.add("opacity");

      setTimeout(() => {
        incoming.style.display = "none";
        endcard.style.display = "block";
        endcard.classList.add("opacity2");
      }, 250);
    });
    function gameCompleted() {
      parent.postMessage('complete', '*');
      console.log("Ad experience has completed");
    };

    function handleCTA() {
      try {
        if (typeof FbPlayableAd !== 'undefined' && FbPlayableAd.onCTAClick) {
          FbPlayableAd.onCTAClick();
          parent.postMessage('download', '*');
          gameCompleted();
          return;
        }
      } catch (e) {
        console.warn('FbPlayableAd error:', e);
      }

      if (typeof AL !== 'undefined' && AL.openStoreUrl) {
        AL.openStoreUrl();
        gameCompleted();
        return;
      }

      if (typeof mraid !== 'undefined' && mraid.open) {
        mraid.open();
        gameCompleted();
        return;
      }

      //   SDK  
      console.log("CTA clicked  no supported SDK found.");
      parent.postMessage('download', '*');
      gameCompleted();
    }

    const backgroundMusic = document.getElementById('backgroundMusic');
    const ringCall = document.getElementById("ring");

    //  
    function startAudio() {
      if (backgroundMusic.paused) {
        backgroundMusic.play().catch(error => {
          console.error("     :", error);
        });
      }
    }

    let inactivityTimer = null;
    let firstInteractionOccurred = false;

    function resetInactivityTimer() {
      if (!firstInteractionOccurred) return;
      clearTimeout(inactivityTimer);
      inactivityTimer = setTimeout(() => {
        goToEndcard();
      }, 10000);
    }

    function goToEndcard() {
      container.style.display = "none";
      incoming.style.display = "none";
      first.style.display = "none";
      second.style.display = "none";
      endcard.style.display = "block";
      endcard.classList.add("opacity2");
      container.classList.add("veal");
      footer.forEach((item) => {
        item.style.display = "none";
      });
    }

    function onFirstUserInteraction() {
      if (firstInteractionOccurred) return;
      firstInteractionOccurred = true;
      resetInactivityTimer();

      ["click", "touchstart", "mousemove", "keydown"].forEach((evt) => {
        document.addEventListener(evt, resetInactivityTimer);
      });
    }

    ["click", "touchstart"].forEach(evt => {
      document.addEventListener(evt, onFirstUserInteraction, { once: true });
    });


    //  
    function stopAudio() {
      if (!backgroundMusic.paused) {
        backgroundMusic.pause();
        ringCall.pause()
      }
    }

    // ,    (display  none)
    function isVisible(el) {
      return el && window.getComputedStyle(el).display !== 'none';
    }


    //    
    document.addEventListener("visibilitychange", function () {
      if (document.hidden) {
        stopAudio(); //     
      } else {
        startAudio(); //      
      }
    });

    // ,   
    if (typeof mraid !== 'undefined') {
      //   MRAID
      mraid.addEventListener('ready', function () {
        mraid.addEventListener('viewableChange', function (viewable) {
          if (viewable) {
            startAudio();
          } else {
            stopAudio();
          }
        });
      });
    }
    // :      
    document.addEventListener('touchstart', startAudio);
    document.addEventListener('scroll', startAudio);
    document.addEventListener('click', startAudio);
  </script>
